import React, { useState } from "react";

export default function Home() {
  const [deg, setDeg] = useState(0);

  setInterval(() => {
    setDeg(() => {
      return;
    });
  }, 1000);
  return (
    <div>
      <div className="timer">
        <div className="circle"></div>
        <div
          className="circle-inside"
          style={{
            transform: `rotate(${timer}deg)`,
          }}
        >
          <div className="dot"></div>
        </div>
      </div>
    </div>
  );
}
